import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const indexpage = () => (
    <div>
        <h1>The main Page</h1>
        <p>Goto  <Link href="/auth"><a>Auth</a></Link> </p>
        <button onClick={()=> {Router.push('/auth') }} />
    </div>
);

export default indexpage;
